export default function About() {
  return (
    <section id="about" className="my-12 text-center px-4">
      <img
        src="portfolio\src\static\img\FotoPerfil.png"  
        alt="Alejandro Ibañez Samalea"
        className="w-32 h-32 mx-auto rounded-full shadow mb-4 object-cover"
      />
      <h2 className="text-3xl font-bold mb-2">Alejandro Ibañez Samalea</h2>
      <p className="max-w-xl mx-auto text-lg text-gray-700">
        Soy un desarrollador apasionado por la tecnología, especializado en desarrollo web moderno,
        interfaces limpias y funcionales, y la creación de experiencias digitales intuitivas.
      </p>
    </section>
  );
}
